import React from 'react'

export const Char = (props) => {
    const style = {
        display: 'inline-block',
        padding: '16px',
        margin: '16px',
        border: '1px solid black',
        textAlign: 'center',

    }
    return (
        <div style = {style}>
            {props.character}
        </div>
    )
}
